import './App.css';
import Mensaje from './Mensaje';


const Description = () => {
  return <p>Esta es la app del curso fullstack</p>
}

function App() {
  return (
    <div className="App">
      <Mensaje message='Estamos trabajando' />
      <Mensaje message='en un curso' />
      <Mensaje message='de React' />
      <Description />

    </div>
  );
}

export default App;
